export const NewQuestion = () => {
    const [text, setText] = useState('')
    const handleChange = (event) => {
    setText(event.target.value)
    }
  return (
    <>
      <form className>
        <h3>Ask a question...</h3>
        <div>
        <label>Title</label>
          <textarea
            value={text}
          />
        </div>
        <div>
        <label>Body</label>
          <textarea
            value={text}
            onChange={handleChange}
          />
        </div>
        <div>
          <h2 />
          <p>{text}</p>
          <input type='submit' value='Submit' />
        </div>
      </form>
    </>
  )
}
